import React from 'react'
import { TeamList } from '../Alies'

const Fetchers = async (teamList:TeamList) => {


    await fetch('http://localhost:9091/teaminfo', {
        method: 'GET'})
    .then(res => res.json())
    .then(data => {
        teamList = data["Value"]
    })

}

export default Fetchers
